export function createMenuHTML(assetUrls: Record<string, string>): string {
  const PAGE1 = "data:image/png;base64,";
  const PAGE2 = "data:image/png;base64,";
  return `
<!DOCTYPE html>
<html>
<head>
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
<style>
@import url('https://fonts.googleapis.com/css2?family=UnifrakturMaguntia&family=Cinzel:wght@400;600&family=Cinzel+Decorative:wght@400&display=swap');
* { margin:0; padding:0; box-sizing:border-box; }
html,body {
  width:100%; height:100%; overflow:hidden; background:#050203;
  touch-action:none; -webkit-touch-callout:none;
  -webkit-user-select:none; user-select:none;
}

/*  CANVAS BACKGROUND  */
canvas { position:fixed; top:0; left:0; z-index:0; }

/*  SCENE  */
#scene {
  position:fixed; inset:0; z-index:1;
  display:flex; align-items:center; justify-content:center;
  opacity:0; transition:opacity 1.2s ease;
}
#scene.visible { opacity:1; }

/*  BOOK  */
#book {
  position:relative;
  display:flex;
  filter: drop-shadow(0 20px 60px rgba(0,0,0,0.95)) drop-shadow(0 0 40px rgba(80,20,10,0.3));
}

.page {
  position:relative;
  width:var(--page-w);
  height:var(--page-h);
  overflow:hidden;
}
.page-img {
  position:absolute; inset:0;
  width:100%; height:100%;
  object-fit:cover;
  pointer-events:none;
}

/*  SPINE  */
#spine {
  width:18px;
  background:linear-gradient(to bottom, #1a0a05, #2d1208, #1a0a05);
  box-shadow: -4px 0 12px rgba(0,0,0,0.8), 4px 0 12px rgba(0,0,0,0.8),
              inset 2px 0 4px rgba(180,80,20,0.15), inset -2px 0 4px rgba(180,80,20,0.15);
  z-index:2;
  flex-shrink:0;
}

/*  LEFT PAGE  MAIN MENU  */
#left-content {
  position:absolute; inset:0;
  display:flex; flex-direction:column;
  align-items:center; justify-content:center;
  padding:8% 10%;
  z-index:1;
}

.book-title {
  font-family:"Cinzel Decorative", "Cinzel", Georgia, serif;
  font-size:clamp(11px,2.2vw,18px);
  color:rgba(90,45,15,0.9);
  text-align:center;
  letter-spacing:3px;
  line-height:1.4;
  margin-bottom:6%;
  text-shadow: 0 1px 2px rgba(0,0,0,0.5);
}
.book-title .subtitle {
  display:block;
  font-family:"Cinzel", Georgia, serif;
  font-size:0.55em;
  letter-spacing:5px;
  color:rgba(80,38,12,0.7);
  margin-top:4px;
  font-weight:400;
}
.title-ornament {
  width:60%; height:1px; margin:0 auto 6%;
  background:linear-gradient(90deg,transparent,rgba(80,38,12,0.5),transparent);
}

.menu-items { width:100%; }

.menu-item {
  display:block; width:100%;
  padding:clamp(6px,1.2vh,10px) 0;
  text-align:center;
  font-family:"Cinzel", Georgia, serif;
  font-size:clamp(9px,1.6vw,13px);
  letter-spacing:4px;
  color:rgba(70,33,10,0.75);
  text-transform:uppercase;
  cursor:pointer;
  position:relative;
  border:none; background:none;
  -webkit-tap-highlight-color:transparent;
  transition:color 0.2s, text-shadow 0.2s;
  text-shadow: 0 1px 2px rgba(0,0,0,0.3);
}
.menu-item::before, .menu-item::after {
  content:''; position:absolute;
  left:10%; right:10%; height:1px;
  background:linear-gradient(90deg,transparent,rgba(80,38,12,0.25),transparent);
  transition:opacity 0.2s;
}
.menu-item::before { top:0; }
.menu-item::after  { bottom:0; }
.menu-item:first-child::before { opacity:0; }

.menu-item.active, .menu-item:active {
  color:rgba(110,48,12,1);
  text-shadow: 0 0 12px rgba(150,60,10,0.4), 0 1px 2px rgba(0,0,0,0.5);
}
.menu-item.selected {
  color:rgba(120,52,14,1);
  text-shadow: 0 0 16px rgba(150,60,10,0.5);
}
.menu-item.selected::before, .menu-item.selected::after {
  background:linear-gradient(90deg,transparent,rgba(100,45,12,0.5),transparent);
}

.menu-glyph {
  display:inline-block; margin:0 6px;
  font-size:0.75em; opacity:0.5;
  transition:opacity 0.2s;
}
.menu-item.selected .menu-glyph { opacity:0.9; }

/*  RIGHT PAGE  PANELS  */
#right-content {
  position:absolute; inset:0;
  z-index:1; overflow:hidden;
}

.panel {
  position:absolute; inset:0;
  display:flex; flex-direction:column;
  align-items:center; justify-content:center;
  padding:8% 10%;
  opacity:0; pointer-events:none;
  transition:opacity 0.5s ease;
}
.panel.active { opacity:1; pointer-events:auto; }

/* Welcome panel */
#panel-welcome {
  text-align:center;
}
.welcome-symbol {
  font-size:clamp(28px,6vw,52px);
  color:rgba(70,33,10,0.4);
  margin-bottom:5%;
  line-height:1;
  filter:blur(0.5px);
}
.welcome-text {
  font-family:"Cinzel", Georgia, serif;
  font-size:clamp(8px,1.3vw,11px);
  color:rgba(70,33,10,0.55);
  letter-spacing:3px;
  text-transform:uppercase;
  line-height:2;
  text-align:center;
}

/* Panel header */
.panel-header {
  font-family:"Cinzel Decorative","Cinzel",Georgia,serif;
  font-size:clamp(10px,1.8vw,15px);
  color:rgba(90,42,12,0.85);
  letter-spacing:4px;
  text-transform:uppercase;
  margin-bottom:4%;
  text-align:center;
  text-shadow:0 1px 3px rgba(0,0,0,0.4);
}
.panel-rule {
  width:70%; height:1px; margin:0 auto 5%;
  background:linear-gradient(90deg,transparent,rgba(80,38,12,0.4),transparent);
}

/* Save slots */
.save-slot {
  width:90%; margin-bottom:clamp(6px,1.2vh,10px);
  padding:clamp(7px,1.3vh,11px) 14px;
  border:1px solid rgba(70,33,10,0.2);
  background:rgba(20,8,3,0.25);
  cursor:pointer;
  display:flex; align-items:center; gap:12px;
  transition:all 0.2s;
  -webkit-tap-highlight-color:transparent;
}
.save-slot:active, .save-slot.pressed {
  background:rgba(60,22,6,0.35);
  border-color:rgba(100,45,12,0.5);
}
.slot-num {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(14px,2.5vw,20px);
  color:rgba(80,38,12,0.5);
  min-width:22px; text-align:center;
}
.slot-info { flex:1; }
.slot-name {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(8px,1.3vw,11px);
  color:rgba(80,38,12,0.75);
  letter-spacing:2px;
}
.slot-meta {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(7px,1vw,9px);
  color:rgba(70,33,10,0.4);
  letter-spacing:1px;
  margin-top:3px;
}
.save-slot.empty .slot-name { color:rgba(70,33,10,0.3); font-style:italic; }

/* Settings */
.setting-row {
  width:88%; display:flex; align-items:center;
  justify-content:space-between;
  padding:clamp(6px,1.1vh,9px) 0;
  border-bottom:1px solid rgba(70,33,10,0.12);
}
.setting-row:last-of-type { border-bottom:none; }
.setting-label {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(7px,1.2vw,10px);
  color:rgba(80,38,12,0.65);
  letter-spacing:3px; text-transform:uppercase;
}
.toggle {
  width:36px; height:18px;
  background:rgba(20,8,3,0.4);
  border:1px solid rgba(70,33,10,0.3);
  border-radius:9px; cursor:pointer; position:relative;
  transition:background 0.3s; -webkit-tap-highlight-color:transparent;
}
.toggle.on { background:rgba(80,30,8,0.5); border-color:rgba(110,48,12,0.5); }
.knob {
  position:absolute; top:2px; left:2px;
  width:12px; height:12px; border-radius:50%;
  background:rgba(100,50,20,0.4); transition:all 0.3s;
}
.toggle.on .knob { left:20px; background:rgba(160,65,20,0.8); }
.vol-wrap { display:flex; align-items:center; gap:8px; }
input[type=range] {
  -webkit-appearance:none; width:80px; height:2px;
  background:rgba(70,33,10,0.3); border-radius:1px; outline:none; cursor:pointer;
}
input[type=range]::-webkit-slider-thumb {
  -webkit-appearance:none; width:11px; height:11px;
  border-radius:50%; background:rgba(130,55,18,0.8);
}
.vol-val {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(7px,1vw,9px);
  color:rgba(70,33,10,0.45); min-width:24px;
}

/* Credits */
.credits-body { text-align:center; width:90%; }
.credit-block { margin-bottom:clamp(10px,2vh,18px); }
.credit-role {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(6px,1vw,9px);
  color:rgba(70,33,10,0.4);
  letter-spacing:3px; text-transform:uppercase; margin-bottom:3px;
}
.credit-name {
  font-family:"Cinzel",Georgia,serif;
  font-size:clamp(8px,1.4vw,12px);
  color:rgba(85,40,12,0.7);
  letter-spacing:2px;
}
.credit-quote {
  margin-top:clamp(10px,2vh,18px);
  font-family:Georgia,serif;
  font-size:clamp(7px,1.1vw,10px);
  color:rgba(70,33,10,0.4);
  font-style:italic;
  line-height:1.9;
}

/* Ink drip / ambient FX */
.ink-overlay {
  position:absolute; inset:0; pointer-events:none;
  background:radial-gradient(ellipse at 50% 100%, rgba(10,3,1,0.3) 0%, transparent 70%);
  mix-blend-mode:multiply;
}

/*  AMBIENT PARTICLES on canvas  */
</style>
</head>
<body>
<canvas id="bg-canvas"></canvas>

<div id="scene">
  <div id="book">
    <!-- LEFT PAGE -->
    <div class="page" id="left-page">
      <img class="page-img" src="${PAGE1}" alt="">
      <div class="ink-overlay"></div>
      <div id="left-content">
        <div class="book-title">
          Chronicles
          <span class="subtitle">of a Fallen World</span>
        </div>
        <div class="title-ornament"></div>
        <div class="menu-items">
          <button class="menu-item" id="mi-new" data-panel="">
            <span class="menu-glyph"></span>New Game<span class="menu-glyph"></span>
          </button>
          <button class="menu-item" id="mi-continue" data-panel="">
            <span class="menu-glyph"></span>Continue<span class="menu-glyph"></span>
          </button>
          <button class="menu-item selected" id="mi-load" data-panel="panel-load">
            <span class="menu-glyph"></span>Load Save<span class="menu-glyph"></span>
          </button>
          <button class="menu-item" id="mi-settings" data-panel="panel-settings">
            <span class="menu-glyph"></span>Settings<span class="menu-glyph"></span>
          </button>
          <button class="menu-item" id="mi-credits" data-panel="panel-credits">
            <span class="menu-glyph"></span>Credits<span class="menu-glyph"></span>
          </button>
        </div>
      </div>
    </div>

    <!-- SPINE -->
    <div id="spine"></div>

    <!-- RIGHT PAGE -->
    <div class="page" id="right-page">
      <img class="page-img" src="${PAGE2}" alt="">
      <div class="ink-overlay"></div>
      <div id="right-content">

        <!-- Welcome -->
        <div class="panel active" id="panel-welcome">
          <div class="welcome-symbol">  </div>
          <div class="welcome-text">
            Select your path<br>from the tome
          </div>
        </div>

        <!-- Load Save -->
        <div class="panel" id="panel-load">
          <div class="panel-header">Bound Souls</div>
          <div class="panel-rule"></div>
          <div id="save-slots"></div>
        </div>

        <!-- Settings -->
        <div class="panel" id="panel-settings">
          <div class="panel-header">Sanctum</div>
          <div class="panel-rule"></div>
          <div class="setting-row">
            <span class="setting-label">Sound</span>
            <div class="toggle on" id="tog-sound"><div class="knob"></div></div>
          </div>
          <div class="setting-row">
            <span class="setting-label">Music</span>
            <div class="toggle on" id="tog-music"><div class="knob"></div></div>
          </div>
          <div class="setting-row">
            <span class="setting-label">Volume</span>
            <div class="vol-wrap">
              <input type="range" id="vol-slider" min="0" max="100" value="80">
              <span class="vol-val" id="vol-val">80</span>
            </div>
          </div>
          <div class="setting-row">
            <span class="setting-label">Vibration</span>
            <div class="toggle on" id="tog-vib"><div class="knob"></div></div>
          </div>
        </div>

        <!-- Credits -->
        <div class="panel" id="panel-credits">
          <div class="panel-header">The Fallen</div>
          <div class="panel-rule"></div>
          <div class="credits-body">
            <div class="credit-block">
              <div class="credit-role">Design &amp; Development</div>
              <div class="credit-name">Chronicles Team</div>
            </div>
            <div class="credit-block">
              <div class="credit-role">Art &amp; Animation</div>
              <div class="credit-name">Chronicles Team</div>
            </div>
            <div class="credit-block">
              <div class="credit-role">Sound &amp; Music</div>
              <div class="credit-name">Chronicles Team</div>
            </div>
            <div class="credit-quote">
              "In the ruins of what was,<br>
              the Architect stirs once more."
            </div>
          </div>
        </div>

      </div>
    </div>
  </div>
</div>

<script>
//  SIZING 
var W = window.innerWidth, H = window.innerHeight;
var IS_LANDSCAPE = W > H;
if (!IS_LANDSCAPE) { var t=W; W=H; H=t; }

var BOOK_H = Math.min(H * 0.88, W * 0.52);
var PAGE_W = Math.floor((Math.min(W * 0.92, BOOK_H * 2.2) - 18) / 2);
var PAGE_H = Math.floor(PAGE_W * 1.42);
BOOK_H = PAGE_H;

document.documentElement.style.setProperty('--page-w', PAGE_W+'px');
document.documentElement.style.setProperty('--page-h', PAGE_H+'px');

//  BACKGROUND CANVAS 
var bgCanvas = document.getElementById('bg-canvas');
var bgCtx = bgCanvas.getContext('2d');
bgCanvas.width = window.innerWidth;
bgCanvas.height = window.innerHeight;

// Ember particles
var embers = [];
for (var i=0;i<40;i++) {
  embers.push({
    x:Math.random()*window.innerWidth, y:Math.random()*window.innerHeight,
    vx:(Math.random()-0.5)*0.3, vy:-0.2-Math.random()*0.4,
    life:Math.random(), size:0.6+Math.random()*1.2,
    r:160+Math.random()*50, g:30+Math.random()*30
  });
}

var frame = 0;
function drawBg() {
  frame++;
  bgCtx.fillStyle = 'rgba(5,2,1,0.18)';
  bgCtx.fillRect(0,0,bgCanvas.width,bgCanvas.height);
  embers.forEach(function(em) {
    em.x += em.vx + Math.sin(frame*0.015+em.y*0.008)*0.15;
    em.y += em.vy;
    em.life -= 0.004;
    if (em.life <= 0 || em.y < -5) {
      em.x = Math.random()*bgCanvas.width;
      em.y = bgCanvas.height + 5;
      em.life = 0.4+Math.random()*0.6;
    }
    var a = em.life * 0.55;
    bgCtx.save();
    bgCtx.globalAlpha = a;
    bgCtx.fillStyle = 'rgb('+em.r+','+em.g+',12)';
    bgCtx.beginPath();
    bgCtx.arc(em.x, em.y, em.size, 0, Math.PI*2);
    bgCtx.fill();
    bgCtx.restore();
  });
  requestAnimationFrame(drawBg);
}
// Init bg solid
bgCtx.fillStyle = '#050203';
bgCtx.fillRect(0,0,bgCanvas.width,bgCanvas.height);
drawBg();

//  SHOW BOOK 
setTimeout(function() {
  document.getElementById('scene').classList.add('visible');
}, 200);

//  SAVE SLOTS 
var saveSlots = [null,null,null];
try {
  for (var s=0;s<3;s++) {
    var raw = localStorage.getItem('game_save_slot_'+s);
    if (raw) saveSlots[s] = JSON.parse(raw);
  }
} catch(e){}

function buildSlots() {
  var c = document.getElementById('save-slots');
  c.innerHTML = '';
  for (var i=0;i<3;i++) {
    var slot = saveSlots[i];
    var meta = slot ? (slot.metadata||slot) : null;
    var div = document.createElement('div');
    div.className = 'save-slot'+(slot?'':' empty');
    div.innerHTML =
      '<div class="slot-num">'+(i+1)+'</div>'+
      '<div class="slot-info">'+
        '<div class="slot-name">'+(slot?(meta&&meta.characterName||'The Architect'):'Empty Vessel')+'</div>'+
        '<div class="slot-meta">'+(slot&&meta&&meta.updatedAt?new Date(meta.updatedAt).toLocaleDateString():'No soul bound')+'</div>'+
      '</div>';
    (function(idx,has){
      div.addEventListener('touchstart',function(e){
        e.preventDefault();
        div.classList.add('pressed');
        setTimeout(function(){ div.classList.remove('pressed'); },200);
        sendMsg(has?{type:'LOAD_SAVE',slot:idx}:{type:'NEW_GAME',slot:idx});
      },{passive:false});
      div.addEventListener('click',function(){
        sendMsg(has?{type:'LOAD_SAVE',slot:idx}:{type:'NEW_GAME',slot:idx});
      });
    })(i,!!slot);
    c.appendChild(div);
  }
}
buildSlots();

//  SETTINGS 
var settings = {sound:true,music:true,volume:80,vibration:true};
try { var sv=localStorage.getItem('game_settings'); if(sv) settings=JSON.parse(sv); } catch(e){}
function saveSettings(){ try{localStorage.setItem('game_settings',JSON.stringify(settings));}catch(e){} }

['sound','music','vibration'].forEach(function(k){
  var id = k==='vibration'?'tog-vib':'tog-'+k;
  var el = document.getElementById(id);
  if(!settings[k]) el.classList.remove('on');
  el.addEventListener('touchstart',function(e){e.preventDefault();settings[k]=!settings[k];el.classList.toggle('on',settings[k]);saveSettings();},{passive:false});
  el.addEventListener('click',function(){settings[k]=!settings[k];el.classList.toggle('on',settings[k]);saveSettings();});
});
var volSlider = document.getElementById('vol-slider');
var volVal = document.getElementById('vol-val');
volSlider.value = settings.volume;
volVal.textContent = settings.volume;
volSlider.addEventListener('input',function(){settings.volume=parseInt(volSlider.value);volVal.textContent=settings.volume;saveSettings();});

//  PANEL ROUTING 
var currentPanel = 'panel-welcome';
function showPanel(id) {
  document.querySelectorAll('.panel').forEach(function(p){ p.classList.remove('active'); });
  if (id) document.getElementById(id).classList.add('active');
  currentPanel = id;
}

//  MENU ITEMS 
document.querySelectorAll('.menu-item').forEach(function(btn){
  function activate(e) {
    if (e.type==='touchstart') e.preventDefault();
    var id = btn.id;
    var panel = btn.dataset.panel;

    // Remove selected from all, add to this
    document.querySelectorAll('.menu-item').forEach(function(b){ b.classList.remove('selected'); });
    btn.classList.add('selected');

    if (id === 'mi-new') {
      sendMsg({type:'NEW_GAME',slot:0});
      return;
    }
    if (id === 'mi-continue') {
      var latest=-1, latestT=0;
      saveSlots.forEach(function(s,i){ if(s&&s.metadata&&s.metadata.updatedAt>latestT){latest=i;latestT=s.metadata.updatedAt;} });
      sendMsg(latest>=0?{type:'LOAD_SAVE',slot:latest}:{type:'NEW_GAME',slot:0});
      return;
    }
    if (panel) showPanel(panel);
  }
  btn.addEventListener('touchstart', activate, {passive:false});
  btn.addEventListener('click', activate);
});

// Show load panel by default
showPanel('panel-load');
document.getElementById('mi-load').classList.add('selected');

//  MESSAGE BRIDGE 
function sendMsg(data){
  try {
    if (window.ReactNativeWebView) window.ReactNativeWebView.postMessage(JSON.stringify(data));
    else window.parent.postMessage(JSON.stringify(data),'*');
  } catch(e){}
}

//  RESIZE 
window.addEventListener('resize', function(){
  bgCanvas.width=window.innerWidth; bgCanvas.height=window.innerHeight;
  bgCtx.fillStyle='#050203'; bgCtx.fillRect(0,0,bgCanvas.width,bgCanvas.height);
});
</script>
</body>
</html>
`;
}
